function countDown(){"use strict";var t,n,e,o=10,r=new Date,u=60*r.getUTCHours(),c=r.getUTCMinutes(),i=r.getUTCSeconds(),d=u+c,s=function(t){return("0"+Math.floor(t)).slice(-2)};for(t=6;t>0;t-=1){for(n=6400;d<=n;)n-=o;(e=n+o-d)<1&&(e=o),o*=2,n=60*e-i,document.getElementById("count"+t).innerHTML=s(n/3600)+":"+s(n%3600/60)+":"+s(60-i)}document.getElementById("currentDate").innerHTML=r.toUTCString(),px=Math.floor((60*((u<12?u+24:u)+c)+i)/30)+-405}var px;document.addEventListener("DOMContentLoaded",function(){"use strict";countDown()});